import React  from 'react';

const Card = ({ movie }) => {
    this.state={}
    navigateToDetailPage = (id) =>{
        const {history} = this.props;
        history.push(`/movie/detail/{id}`, { id: id });
    }
    return (
        <div className='card'>
            <div className='card-body'>
                <h2 className='card-title'>{`#${movie.runtime} - ${movie.original_title} (${movie.release_date})` }</h2>
            </div>
            <ul className='list-group list-group-flush'>
                <li className='list-group-item'>{`Status: ${movie.status}`}</li>
                <li className='list-group-item'>{`Vote Count: ${movie.vote_count}`}</li>
                <li className='list-group-item'><button className='btn btn-primary btn-sm' onPress={() => navigateToDetailPage(movie.id)}>Detail</button></li>
            </ul>
        </div>
    );
};

export default Card;
